//引入Vue
import Vue from 'vue'
//引入App
import App from './App.vue'
Vue.config.Vue.config.productionTip = false


// 创建Vue实例
new Vue({
    // el: '#App',
    // render: h => (h)
    render: h => h(App)
    // router
}).$mount('#app')
